                  <p ref={sectionTwoText}>
                    Me destaco en la parte del desarrollo orientado al frontend,
                    aun asi, domino ciertas tecnologías de backend que aprendí
                    con el propósito de comprender el funcionamiento interno de
                    la web, como por ejemplo, las bases de datos, las Rest API,
                    o metodologías que me permitieron mejorar mi eficiencia y
                    toma de decisiones como los patrones de diseño.
                    <br />
                    Además domino ciertas librerías que me permiten brindar una
                    experiencia de usuario más dinámica que aumente la retención
                    del mismo, como por ejemplo: Framer-Motion o Greensock
                    Animation Platform.
                  </p>
